import React from 'react';
import './index.css';

export default function App() {
  const cart = [
    ["Leah", "Makgatho", 29, "Hoog"],
    ["Kabo", "Makgatho", 7, "Lebowakgomo"],
    ["Julia", "Masipa", 62, "Midrand"],
  ];

  return (
    <div>
      {cart.map((items, index) =>{
        return (
          <ol>
            {items.map((subItems, sIndex) => {
              return <li> {subItems} </li>;
            })}
          </ol>
        );
      })}
    </div>
  );
}
